import './App.css';
import officeImage from './office.jpg'; 

function App() {
  const heading = "Office Space";

  const office = {
    Name: "DBS",
    Rent: 60000, // Change this value to see the rent color change
    Address: "Chennai"
  };

  const rentStyle = {
    color: office.Rent <= 60000 ? 'red' : 'green'
  };

  return (
    <div className="App">
      <h1>{heading}, at Affordable Range</h1>

      <img
        src={officeImage}
        alt="Office Space"
        width="25%"
        height="25%"
      />

      <h2>Name: {office.Name}</h2>
      <h3 style={rentStyle}>Rent: Rs. {office.Rent}</h3>
      <h3>Address: {office.Address}</h3>
    </div>
  );
}

export default App;
